import { Methods, request } from '@/libs/request'

export type GetTeaHousesResponseType = {
  id: number;
  name: string;
  location: string;
  specificLocation: string;
  city: string;
  subCity: string;
  latitude: string;
  longitude: string;
  finderName: string;
  finderUserId: string;
  nation: string;
  createdAt: string;
  approved: boolean;
}[]

export const GetTeaHousesResponseType = () => {
  return request<any>({
    baseURL: process.env.REACT_APP_SERVER_ENDPOINT,
    url: '/teahouse/admin',
    method: Methods.GET
  })
}
